import React from "react";

// Example data: Add more cities and attractions as needed
const cityData = [
  {
    city: "Paris",
    image: "https://images.unsplash.com/photo-1502602898657-3e91760cbb34?auto=format&fit=crop&w=600&q=80",
    attractions: [
      "Eiffel Tower",
      "Louvre Museum",
      "Notre-Dame Cathedral"
    ]
  },
  {
    city: "Tokyo",
    image: "https://images.unsplash.com/photo-1464983953574-0892a716854b?auto=format&fit=crop&w=600&q=80",
    attractions: [
      "Tokyo Tower",
      "Senso-ji Temple",
      "Shibuya Crossing"
    ]
  },
  {
    city: "New York",
    image: "https://images.unsplash.com/photo-1465101046530-73398c7f28ca?auto=format&fit=crop&w=600&q=80",
    attractions: [
      "Statue of Liberty",
      "Central Park",
      "Times Square"
    ]
  },
  // ...add more cities as needed
];

const styles = {
  container: {
    maxWidth: 1000,
    margin: "2rem auto",
    padding: "2rem",
    background: "#f7fafc",
    borderRadius: "16px",
    minHeight: "100vh"
  },
  title: {
    fontSize: "2rem",
    fontWeight: 700,
    color: "#2d3a4b",
    marginBottom: "2rem",
    textAlign: "center",
    letterSpacing: "1px",
  },
  cityCard: {
    display: "flex",
    alignItems: "flex-start",
    background: "#fff",
    borderRadius: "14px",
    boxShadow: "0 2px 8px rgba(31,38,135,0.08)",
    marginBottom: "2rem",
    overflow: "hidden"
  },
  cityImage: {
    width: 220,
    height: 160,
    objectFit: "cover",
    borderRadius: "14px 0 0 14px"
  },
  cityInfo: {
    padding: "1.5rem",
    flex: 1
  },
  cityName: {
    fontSize: "1.5rem",
    fontWeight: 600,
    color: "#764ba2",
    marginBottom: "0.7rem"
  },
  attractionsTitle: {
    fontWeight: 500,
    marginBottom: "0.3rem"
  },
  attractionsList: {
    margin: 0,
    paddingLeft: "1.2rem"
  }
};

function Catalogue() {
  return (
    <div style={styles.container}>
      <div style={styles.title}>üåè Destination Catalogue</div>
      {cityData.map(city => (
        <div key={city.city} style={styles.cityCard}>
          <img src={city.image} alt={city.city} style={styles.cityImage} />
          <div style={styles.cityInfo}>
            <div style={styles.cityName}>{city.city}</div>
            <div style={styles.attractionsTitle}>Top Attractions:</div>
            <ul style={styles.attractionsList}>
              {city.attractions.map(attraction => (
                <li key={attraction}>{attraction}</li>
              ))}
            </ul>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Catalogue;
